import React from "react";
import styled from "styled-components";
import css from "@emotion/css";
// import "../assets/css/style.css";

const Container = styled.div`
  background-color: black;
  color: white;
  height: 100vh;
`;

const App = () => (
  <div
    css={css`
      background-color: black;
      color: white;
      height: 100vh;
    `}
  >
    pang
  </div>
);

export default App;
